function checkUrlsInRedirectData(missingUrlsFilePath, redirectData) {
  try {
    const missingUrls = readUrlsFromFile(missingUrlsFilePath);

    const presentUrls = [];
    const notPresentUrls = [];

    for (const missingUrl of missingUrls) {
      if (redirectData.hasOwnProperty(missingUrl)) {
        presentUrls.push(missingUrl);
      } else {
        notPresentUrls.push(missingUrl);
      }
    }

    writeToFile(presentUrlsFile, presentUrls);
    writeToFile(notPresentUrlsFile, notPresentUrls);

    console.log(`Finished checking URLs. Results written to "${presentUrlsFile}" and "${notPresentUrlsFile}".`);
  } catch (error) {
    console.error(`Error: ${error.message}`);
  }
}

function readUrlsFromFile(filePath) {
  try {
    const fileContent = fs.readFileSync(filePath, 'utf-8');
    return fileContent.split('\n').map(url => url.trim());
  } catch (error) {
    throw new Error(`Error reading file "${filePath}": ${error.message}`);
  }
}

function writeToFile(fileName, contentArray) {
  fs.writeFileSync(fileName, contentArray.join('\n'), 'utf-8');
  console.log(`"${fileName}" created with ${contentArray.length} URLs.`);
}

